INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (4, 24, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, "2030/12/17 14:59:59", 110501, 24015, "カオリ（サマー）", 1, 10021, 0.0, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (1, 24, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 4, "2030/12/17 14:59:59", 110501, 24016, "カオリ（サマー）", 2, 10021, 4.0, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (4, 24, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, "2030/12/17 14:59:59", 110501, 24017, "カオリ（サマー）", 3, 10021, 0.0, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (2, 24, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 1, "2030/12/17 14:59:59", 110501, 24018, "カオリ（サマー）", 4, 10021, 5.2, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (6, 24, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, "2030/12/17 14:59:59", 110501, 24019, "カオリ（サマー）", 5, 10021, 4.2, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (2, 24, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, "2030/12/17 14:59:59", 110501, 24020, "カオリ（サマー）", 6, 10021, 0.0, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (6, 24, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 1, "2030/12/17 14:59:59", 110501, 24021, "カオリ（サマー）", 7, 10021, 6.4, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (2, 24, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, "2030/12/17 14:59:59", 110501, 24022, "カオリ（サマー）", 8, 10021, 0.0, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (3, 24, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 6, "2030/12/17 14:59:59", 110501, 24023, "カオリ（サマー）", 9, 10021, 10.08, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (2, 24, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 1, "2030/12/17 14:59:59", 110501, 24024, "カオリ（サマー）", 10, 10021, 5.0, 0.0, 0.0, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (2, 24, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, "2030/12/17 14:59:59", 110501, 24025, "カオリ（サマー）", 11, 10021, 0.0, 0.0, 0.0, "2019/07/31 12:00:00");
